import { Routes } from '@angular/router';

export const routes: Routes = [
  {
    path: '',
    pathMatch: 'full',
    redirectTo: 'home'
  },

  {
    path: 'home',
    loadComponent: () => import('./comment/comment/comment').then(m => m.Comment)
  },

  {
    path: 'teams',
    loadComponent: () => import('./pages/teams/teams').then(m => m.Teams)
  },

  {
    path: 'driver',
    loadComponent: () => import('./pages/driver/driver')
  },

  {
    path: 'race',
    loadComponent: () => import('./pages/race/race')
  },

  {
    path: 'about',
    loadComponent: () => import('./pages/about/about')
  },

];
